import React from "react";
import html from "./icons/html.svg";

const Skills = () => {
    return (
        <>
            <section className="header">
                <div className="container">
                    <div className="row">
                        <div className="col-xs-3 col-sm-2 col-md-2 k-hover">
                            <img src={html} alt="html" className="skill_icon"/>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Skills;
